function initialize(){var e=new google.feeds.Feed("https://github.com/goofiw.atom");e.load(function(e){if(!e.error){console.log(e);for(var t=document.getElementById("github-content"),o=0;o<e.feed.entries.length;o++){var n=e.feed.entries[o],i=document.createElement("div");i.className="list-group",i.innerHTML="<a class='list-group-item' href="+n.link+">"+n.contentSnippet+"</a>",t.appendChild(i)}}})}google.load("feeds","1"),google.setOnLoadCallback(initialize);